import React from "react";
import { useCartStore } from "../../stores";
import { ProductCartItem } from "../../components";

const Cart = () => {
  const { cart } = useCartStore();
  return (
    <div className="cart-container">
      <div className="content-grid">
        {cart.map((item) => (
          <ProductCartItem product={item} />
        ))}
      </div>
    </div>
  );
};

export default Cart;
